  [],\n\t\"revision_timestamp\": \"2015-05-06T22:37:41.967825\",\n\t\"name\": \"integrated-system-management-and-reconfigurable-control-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The team proposes to develop an onboard,
  real-time health management capability that monitors a flight control system (for
  spacecraft, fixed or rotary wing aircraft) in a highly dynamic environment and responds
  to anomalies with suggested recovery or mitigation actions. The goal of the proposed
  capability is to take system/component level health status information and aggregate
  this information across all channels and subsystems to the flight control system
  for anomaly mitigation, failure accommodation, and control re-configuration, based
  on mission objectives. In Phase I, the research will be focused on a preliminary
  design of the component-to-system health capability correlation and the anomaly
  mitigation strategy. In Phase II, the team will conduct a prototype demonstration
  for a relevant space vehicle as the target application.\",\n\t\"license_title\":
